554: @Test public void handlesUnclosedTitle() {
555: Document one = Jsoup.parse("<title>One <b>Two <b>Three</TITLE><p>Test</p>"); // has title, so <b> is plain text
556: assertEquals("One <b>Two <b>Three", one.title());
557: assertEquals("Test", one.select("p").first().text());
558: 559: Document two = Jsoup.parse("<title>One<b>Two <p>Test</p>"); // no title, so <b> causes </title> breakout
560: assertEquals("One", two.title());
561: assertEquals("<b>Two <p>Test</p></b>", two.body().html());
562: }
